import './App.css';
import Index from './pages/Index';
import { Route, Switch, BrowserRouter as Router } from "react-router-dom";
import { ToastContainer } from 'react-toastify';


function App() {
  return (
    <div className="app-container">
      <Router>
        <Switch>
          <ToastContainer />
          <Route exact patj='/' component={Index} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
